  false,\n\t\"url\": null,\n\t\"notes\": \"Multifamily Portfolio datasets (section
  8 contracts) - The information has been compiled from multiple data sources within
  FHA or its contractors.nHUD oversees more than 22,000 privately owned multifamily
  properties, and more than 1.4 million assisted housing units.  These homes were
  originally financed with FHA-insured or Direct Loans and many are supported with
  Section 8 or other rental assistance contracts.  Our existing stock of affordable
  rental housing is a critical resource for seniors and families who otherwise would
  not have access to safe, decent places to call home.\",\n\t\"license_title\": \"License
